import React, { Component } from 'react';
import LongTermGoal from '../components/LongTermGoal';

class LongTermGoalList extends Component {
  render() {

    const goalNodes = () => {
      this.props.goalList.map(goal => {
        return (
          <LongTermGoal
            description={goal.description}
            timescale={goal.timescale}
            key={goal.id}
          />
        )
      })
    }
    return (
      <div>
        <ul>
          {goalNodes}
        </ul>
      </div>

    )
  }
}

export default LongTermGoalList;
